import React from "react";

import { Wrapper } from "../../styled/general";
import { Menu, MenuTitle, Burgers } from "../home/homestyled";


export default function Index() {
  return (
    <Wrapper>
      <Menu>
        <MenuTitle>My Bucket</MenuTitle>
        <Burgers>
            {[1,2,3,4].map((burger) => {
              return (
                <Burger
                  text={burger}
                />
              );
            })}
          </Burgers>
      </Menu>
    </Wrapper>
  );
}
